export const ProductItem = (props) => {
    const { key, product_name, characteristics } = props;
    return (
        <div>
            <Link to={`/product/${key}`}>{product_name}</Link>
            {/*<h3>{product_name}</h3>*/}
            <p>{characteristics}</p>
        </div>
    );
};
